]

return (
    <div className="stories">
        <div className="story">
                <img src={currentUser.profilePic} />
                <span>{currentUser.name}</span>
                <button>+</button>
    </div>
        {stories.map(story => (
            <div className="story" key={story.id}>
                <img src={story.img} />
                <span>{story.name}</span>
    </div>
        ))}
    </div>
)
}

